import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import Data from '.components/Data';
import Login from './Login';
import Bbdash from './Bbdash';
import Hospitaldas from './Hospitaldas';
import ProtectedRoute from './ProtectedRoute';

const App = () => {
  return (
    <Routes>
      {/* Public routes */}
      <Route path="/home" element={<ProtectedRoute element={Home} public={true} />} />
      <Route path="/data" element={<ProtectedRoute element={Data} public={true} />} />
      <Route path="/login" element={<ProtectedRoute element={Login} public={true} />} />

      {/* Protected routes */}
      <Route path="/bb-dash" element={<ProtectedRoute element={Bbdash} userType="blood_bank" isAdmin={true} />} />
      <Route path="/hos-data" element={<ProtectedRoute element={Hospitaldas} userType="hospital" />} />
    </Routes>
  );
};

export default App;
